INSERT INTO `v1_6c031190c72116644994087fd38e2fae0e8870548437f56d14ac13527ce71ff0` VALUES (4, 0.0, 0.0, "あうぅ～残念さ～\nマジムンに魂を\n奪われちゃったかな～？", 110501, 1, "2030/12/17 14:59:59", 10021, "カオリ（サマー）", 24, "2019/07/31 12:00:00", 24015, 0.0, 4);
INSERT INTO `v1_6c031190c72116644994087fd38e2fae0e8870548437f56d14ac13527ce71ff0` VALUES (4, 4.0, 0.0, "今日は踊りのキレも悪いよ～\nゴーヤーっぽいもの食べて、元気回復さ～！", 110501, 2, "2030/12/17 14:59:59", 10021, "カオリ（サマー）", 24, "2019/07/31 12:00:00", 24016, 0.0, 1);
INSERT INTO `v1_6c031190c72116644994087fd38e2fae0e8870548437f56d14ac13527ce71ff0` VALUES (4, 0.0, 0.0, "マジムンだらけで目が回るさ～！\nふらふらさ～！", 110501, 3, "2030/12/17 14:59:59", 10021, "カオリ（サマー）", 24, "2019/07/31 12:00:00", 24017, 0.0, 4);
INSERT INTO `v1_6c031190c72116644994087fd38e2fae0e8870548437f56d14ac13527ce71ff0` VALUES (1, 5.2, 0.0, "なんくるない、なんくるない\n次、頑張ればいいんだよ～！\n海で泳いで\nリフレッシュするさー！", 110501, 4, "2030/12/17 14:59:59", 10021, "カオリ（サマー）", 24, "2019/07/31 12:00:00", 24018, 0.0, 2);
INSERT INTO `v1_6c031190c72116644994087fd38e2fae0e8870548437f56d14ac13527ce71ff0` VALUES (5, 4.2, 0.0, "恥ずかしいところ\n見られちゃったね～\n水着？　水着のことじゃないよー？", 110501, 5, "2030/12/17 14:59:59", 10021, "カオリ（サマー）", 24, "2019/07/31 12:00:00", 24019, 0.0, 6);
INSERT INTO `v1_6c031190c72116644994087fd38e2fae0e8870548437f56d14ac13527ce71ff0` VALUES (2, 0.0, 0.0, "絶好調さ～！　この調子で\n海の平和を取り戻すよ～！\n楽しい夏が待ってるさ～！", 110501, 6, "2030/12/17 14:59:59", 10021, "カオリ（サマー）", 24, "2019/07/31 12:00:00", 24020, 0.0, 2);
INSERT INTO `v1_6c031190c72116644994087fd38e2fae0e8870548437f56d14ac13527ce71ff0` VALUES (1, 6.4, 0.0, "何匹で襲ってきたって\n私はマブイを落っことさないよ～！\nくしゅん！　あ……\n今のくしゃみで落っこちたかも～？", 110501, 7, "2030/12/17 14:59:59", 10021, "カオリ（サマー）", 24, "2019/07/31 12:00:00", 24021, 0.0, 6);
INSERT INTO `v1_6c031190c72116644994087fd38e2fae0e8870548437f56d14ac13527ce71ff0` VALUES (2, 0.0, 0.0, "ひーやーさーさー♪\n戦いの後は、踊りを踊って\n気分スッキリさ～！", 110501, 8, "2030/12/17 14:59:59", 10021, "カオリ（サマー）", 24, "2019/07/31 12:00:00", 24022, 0.0, 2);
INSERT INTO `v1_6c031190c72116644994087fd38e2fae0e8870548437f56d14ac13527ce71ff0` VALUES (6, 10.08, 0.0, "あれ～？　戦ってるうちに\n水着がどっか行っちゃった～？\nねぇキミ、どっかで見なかった～？\nなんで離れるさ～？", 110501, 9, "2030/12/17 14:59:59", 10021, "カオリ（サマー）", 24, "2019/07/31 12:00:00", 24023, 0.0, 3);
INSERT INTO `v1_6c031190c72116644994087fd38e2fae0e8870548437f56d14ac13527ce71ff0` VALUES (1, 5.0, 0.0, "まだまだ私は元気だよ～！\nマジムンでもなんでも、\nどんとこーいさー♪", 110501, 10, "2030/12/17 14:59:59", 10021, "カオリ（サマー）", 24, "2019/07/31 12:00:00", 24024, 0.0, 2);
INSERT INTO `v1_6c031190c72116644994087fd38e2fae0e8870548437f56d14ac13527ce71ff0` VALUES (2, 0.0, 0.0, "私の空手は世界最強さ～！\n夏の陽射しと青い海も合わされば、\n向かうところ敵なしだよー！", 110501, 11, "2030/12/17 14:59:59", 10021, "カオリ（サマー）", 24, "2019/07/31 12:00:00", 24025, 0.0, 2);
